import $ from "jquery";

const Custom = () => {
    return(
        $(document).ready(function (){
            $('.burgerBtn').click(function(){
                $('.nav_menu').show("slow");
            });

            $('.menu-close').click(function(){
                $('.nav_menu').hide("slow");
            });
        })
    );
}

export default Custom
